/* module gradientAnimate */
// function on
jQuery(document).ready(function() {
	gradientAnimateInit();
});

// function init
function gradientAnimateInit() {
	var granimInstance = new Granim({
		element: '#canvas-basic',
		direction: 'left-right',
		isPausedWhenNotInView: true,
		states: {
			"default-state": {
				gradients: [
					['#ff9966', '#ff5e62'],
					['#00F260', '#0575E6'],
					['#e1eec3', '#f05053']
				]
			}
		}
	});
	//Complex gradient animation
	var granimInstance = new Granim({
		element: '#canvas-complex',
		direction: 'left-right',
		isPausedWhenNotInView: true,
		states: {
			"default-state": {
				gradients: [
					[{ color: '#833ab4', pos: .2 }, { color: '#fd1d1d', pos: .8 }, { color: '#38ef7d', pos: 1 }],
					[{ color: '#40e0d0', pos: 0 }, { color: '#ff8c00', pos: .2 }, { color: '#ff0080', pos: .75 }],
				]
			}
		}
	});
	//Gradient animation with an image and blending mode
	var granimInstance = new Granim({
		element: '#canvas-image-blending',
		direction: 'top-bottom',
		isPausedWhenNotInView: true,
		image: {
			source: 'https://loremflickr.com/1300/700',
			blendingMode: 'multiply',
		},
		states: {
			"default-state": {
				gradients: [
					['#29323c', '#485563'],
					['#FF6B6B', '#556270'],
					['#80d3fe', '#7ea0c4'],
					['#f0ab51', '#eceba3']
				],
				transitionSpeed: 7000
			}
		}
	});
	//Gradients with an image mask
	var granimInstance = new Granim({
		element: '#logo-canvas',
		direction: 'left-right',
		states: {
			"default-state": {
				gradients: [
					['#EB3349', '#F45C43'],
					['#FF8008', '#FFC837'],
					['#4CB8C4', '#3CD3AD'],
					['#24C6DC', '#514A9D'],
					['#FF512F', '#DD2476'],
					['#DA22FF', '#9733EE']
				],
				transitionSpeed: 2000
			}
		}
	});
	//Interactive Gradients
	var granimInstance = new Granim({
		element: '#canvas-interactive',
		name: 'interactive-gradient',
		elToSetClassOn: '.canvas-interactive-wrapper',
		direction: 'diagonal',
		isPausedWhenNotInView: true,
		stateTransitionSpeed: 500,
		states: {
			"default-state": {
				gradients: [
					['#B3FFAB', '#12FFF7'],
					['#ADD100', '#7B920A'],
					['#1A2980', '#26D0CE']
				],
				transitionSpeed: 10000
			},
			"violet-state": {
				gradients: [
					['#9D50BB', '#6E48AA'],
					['#4776E6', '#8E54E9']
				],
				transitionSpeed: 2000
			},
			"orange-state": {
				gradients: [
					['#FF4E50', '#F9D423']
				],
				loop: false
			}
		}
	});
	// With jQuery
	$('#default-state-cta').on('click', function(event) {
		event.preventDefault();
		granimInstance.changeState('default-state');
		setClass('#default-state-cta')
	});
	$('#violet-state-cta').on('click', function(event) {
		event.preventDefault();
		granimInstance.changeState('violet-state');
		setClass('#violet-state-cta')
	});
	$('#orange-state-cta').on('click', function(event) {
		event.preventDefault();
		granimInstance.changeState('orange-state');
		setClass('#orange-state-cta')
	});

	function setClass(element) {
		$('.canvas-interactive-wrapper a').removeClass('active');
		$(element).addClass('active');
	};
}

