/* module svgAnimateCustom */
// function on
jQuery(document).ready(function() {
	svgAnimateCustomInit();
});
// function init
function svgAnimateCustomInit() {
	const calcPaths = (totalDur) => {
		// Ð·Ð°Ð´Ð°ÐµÐ¼ ÐºÐ»Ð°ÑÑ 'animated' Ð´Ð»Ñ body, ÑÑÐ¾ Ð¿ÑÐ¸Ð²ÐµÐ´ÐµÑ Ðº Ð¿ÐµÑÐµÐ·Ð°Ð³ÑÑÐ·ÐºÐµ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ð¸
		document.body.classList.add('animated')
		// Ð²ÑÐ±Ð¸ÑÐ°ÐµÐ¼ Ð²ÑÐµ SVG ÑÐ»ÐµÐ¼ÐµÐ½ÑÑ - Ð»Ð¸Ð½Ð¸Ð¸ Ð¸ ÑÐ¾ÑÐºÐ¸
		const paths = document.querySelectorAll('.autograph__path')
		// Ð¾Ð±ÑÑÐ²Ð»ÑÐµÐ¼ Ð¿ÐµÑÐµÐ¼ÐµÐ½Ð½ÑÑ Ð´Ð»Ñ Ð´Ð»Ð¸Ð½Ñ path
		let len = 0
		// Ð·Ð°Ð´Ð°ÐµÐ¼ Ð¿ÐµÑÐµÐ¼ÐµÐ½Ð½ÑÑ Ð´Ð»Ñ Ð²ÑÐµÐ¼ÐµÐ½Ð¸ Ð·Ð°Ð´ÐµÑÐ¶ÐºÐ¸ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ð¸
		let delay = 0
		// Ð²ÑÑÐ¾Ð´Ð¸Ð¼ ÐµÑÐ»Ð¸ Ð½Ð¸ Ð¾Ð´Ð½Ð¾Ð³Ð¾ ÑÐ»ÐµÐ¼ÐµÐ½ÑÐ° Ð½Ðµ Ð½Ð°Ð¹Ð´ÐµÐ½Ð¾
		if (!paths.length) {
			return false
		}
		// ÑÑÑÐ°Ð½Ð°Ð²Ð»Ð¸Ð²Ð°ÐµÐ¼ Ð´Ð»Ð¸ÑÐµÐ»ÑÐ½Ð¾ÑÑÑ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ð¸ Ð² ÑÐµÐºÑÐ½Ð´Ð°Ñ (ÐµÑÐ»Ð¸ Ð¾Ð½Ð° Ð½Ðµ Ð·Ð°Ð´Ð°Ð½Ð°)
		const totalDuration = totalDur || 7
		// Ð²ÑÑÑÐ¸ÑÑÐ²Ð°ÐµÐ¼ Ð¾Ð±ÑÑÑ Ð´Ð»Ð¸Ð½Ñ path
		paths.forEach((path) => {
			const totalLen = path.getTotalLength()
			len += totalLen
		})
		paths.forEach((path) => {
			const pathElem = path
			// Ð¿Ð¾Ð»ÑÑÐ°ÐµÐ¼ ÑÐµÐºÑÑÑÑ Ð´Ð»Ð¸Ð½Ñ path
			const totalLen = path.getTotalLength()
			// Ð¿Ð¾Ð»ÑÑÐ°ÐµÐ¼ ÑÐµÐºÑÑÑÑ Ð¿ÑÐ¾Ð´Ð¾Ð»Ð¶Ð¸ÑÐµÐ»ÑÐ½Ð¾ÑÑÑ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ð¸
			const duration = totalLen / len * totalDuration
			// Ð·Ð°Ð´Ð°ÐµÐ¼ Ð·Ð°Ð´ÐµÑÐ¶ÐºÑ Ð¸ Ð¿ÑÐ¾Ð´Ð¾Ð»Ð¶Ð¸ÑÐµÐ»ÑÐ½Ð¾ÑÑÑ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ð¸
			pathElem.style.animationDuration = `${duration < 0.2 ? 0.2 : duration}s`
			pathElem.style.animationDelay = `${delay}s`
			// ÑÑÑÐ°Ð½Ð°Ð²Ð»Ð¸Ð²Ð°ÐµÐ¼ Ð·Ð½Ð°ÑÐµÐ½Ð¸Ñ dasharray Ð¸ dashoffset ÑÐ°Ð²Ð½ÑÐ¼Ð¸ Ð´Ð»Ð¸Ð½Ðµ path
			// ÑÐ°ÐºÐ¸Ð¼ Ð¾Ð±ÑÐ°Ð·Ð¾Ð¼ Ð¼Ñ Ð¿ÑÑÑÐµÐ¼ Ð»Ð¸Ð½Ð¸Ñ
			pathElem.setAttribute('stroke-dasharray', totalLen)
			pathElem.setAttribute('stroke-dashoffset', totalLen)
			// ÑÑÑÐ°Ð½Ð°Ð²Ð»Ð¸Ð²Ð°ÐµÐ¼ Ð·Ð°Ð´ÐµÑÐ¶ÐºÑ Ð´Ð»Ñ ÑÐ»ÐµÐ´ÑÑÑÐµÐ³Ð¾ path
			// ÑÐµÐ¹ÑÐ°Ñ Ð´Ð¾Ð±Ð°Ð²Ð»ÐµÐ½Ð¾ 0,2 ÑÐµÐºÑÐ½Ð´Ñ Ð´Ð»Ñ Ð±Ð¾Ð»ÑÑÐµÐ¹ ÑÐµÐ°Ð»Ð¸ÑÑÐ¸ÑÐ½Ð¾ÑÑÐ¸
			delay += duration + 0.2
		})
		// Ð·Ð°Ð´Ð°ÐµÐ¼ Ð´Ð»Ñ body ÐºÐ»Ð°ÑÑ 'animated' ÐºÐ¾ÑÐ¾ÑÑÐ¹ Ð·Ð°Ð¿ÑÑÑÐ¸Ñ Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ñ
		document.body.classList.add('animated')
		return true
	}
	calcPaths(10)
}

/* module ionCalendar */
// function on
jQuery(document).ready(function() {
	ionCalendarInit();
});
// function init
// more option see https://github.com/IonDen/ion.calendar
function ionCalendarInit() {
	// Date Picker
	$("#myDatePicker-1").ionDatePicker();
	// Calendar
	$("#myCalendar-1").ionCalendar({
		lang: "ru", // language
		sundayFirst: false, // first week day
		years: "80", // years diapason
		format: "DD.MM.YYYY", // date format
		onClick: function(date) { // click on day returns date
			console.log(date);
		}
	});
}

