/* module animejs */
// function on
jQuery(document).ready(function() {
	animejsInit();
});
// function init
function animejsInit() {
	// 	 test 1
	var blockTest1 = anime({
		targets: '.css-selector-demo1 .el',
		autoplay: false,
		easing: 'linear',
		direction: 'alternate',
		duration: 2000,
		loop: 4,
		// delay: 500,
		// endDelay: 500,
		// el - The curent animated targeted element
		// i - The index of the animated targeted element
		// l - The total number of animated targets
		delay: function(el, i, l) {
			return i * 500;
		},
		endDelay: function(el, i, l) {
			return (l - i) * 500;
		},
		borderRadius: ['0% 0%', '20% 50%'],
		backgroundColor: '#F6FF56',
		translateY: {
			value: function() { return anime.random(-50, -200) },
			duration: 1000
		},
		scale: {
			value: 0.5,
			duration: 2000,
		},
		translateX: {
			value: function(el, i, l) {
				return 300 + i * 200;
			},
			duration: 3000
		},
		rotate: {
			value: 360,
			duration: 3000,
		},
	});
	$('.css-selector-demo1 .btn-animate-go button').on('click', function(e) {
		blockTest1.restart();
	});
	// 	test 2
	var roundLogEl = document.querySelector('.round-log');
	var blockTest2 = anime({
		targets: roundLogEl,
		autoplay: false,
		innerHTML: [0, 10000],
		easing: 'linear',
		round: 1,
		duration: 10000,
	});
	$('.css-selector-demo2 .btn-animate-go button').on('click', function(e) {
		blockTest2.restart();
	});
	// 	 test 3
	var blockTest3 = anime({
		targets: '.css-selector-demo3 .el',
		autoplay: false,
		easing: 'easeOutElastic(1, .8)',
		direction: 'alternate',
		duration: 4000,
		keyframes: [{ translateY: -50 }, { translateX: 450 }, { translateY: 50 }, { translateX: 0 }, { translateY: 0 }],
	});
	$('.css-selector-demo3 .btn-animate-go button').on('click', function(e) {
		blockTest3.restart();
	});
	// 	 test 4
	var blockTest4 = anime({
		targets: '.css-selector-demo4 .el',
		autoplay: false,
		translateX: 270,
		delay: anime.stagger(100, { start: 300, from: 'center' }),
	});
	$('.css-selector-demo4 .btn-animate-go button').on('click', function(e) {
		blockTest4.restart();
	});
	// 	 test 5
	// Create a timeline with default parameters
	var tl = anime.timeline({
		autoplay: false,
		duration: 1500,
		easing: 'easeOutExpo',
		direction: 'alternate',
	});
	tl.add({
		targets: '.css-selector-demo5 .el:nth-of-type(1)',
		translateX: 250,
	}).add({
		targets: '.css-selector-demo5 .el:nth-of-type(2)',
		translateY: -250
	}, '+=600').add({
		targets: '.css-selector-demo5 .el:nth-of-type(3)',
		translateX: 350,
		translateY: -350,
	});
	$('.css-selector-demo5 .btn-animate-go button').on('click', function(e) {
		tl.restart();
	});
	// test 6
	// https://redstapler.co/svg-morphing-animation-animejs/ and https://codepen.io/anthonydugois/pen/mewdyZ and https://www.youtube.com/watch?v=mAKYW_1f-dw
	var blockTest6 = anime({
		autoplay: false,
		targets: '#demo-svg polygon',
		points: [{ value: '87 472,87 91,267 80,501 78,489 304,500 450,293 457' }, { value: '126 263,281 317,475 132,405 417,530 535,29 490,202 365' }],
		duration: 2500,
		easing: 'linear',
		direction: 'alternate'
	});
	$('.css-selector-demo6 .btn-animate-go button').on('click', function(e) {
		blockTest6.restart();
	});
	// test 7
	var blockTest7 = anime({
		autoplay: false,
		targets: '.css-selector-demo7 .lines path',
		strokeDashoffset: [anime.setDashoffset, 0],
		easing: 'easeInOutSine',
		duration: 1500,
		delay: function(el, i) { return i * 250 },
		direction: 'alternate',
		loop: true
	});
	$('.css-selector-demo7 .btn-animate-go button').on('click', function(e) {
		blockTest7.restart();
	});
	// test 8
	var path = anime.path('.css-selector-demo8 path');
	var blockTest8 = anime({
		autoplay: false,
		targets: '.css-selector-demo8 .el',
		translateY: path('y'),
		translateX: path('x'),
		// if need rotate element
		// rotate: path('angle'),
		easing: 'linear',
		duration: 5000,
		loop: true
	});
	$('.css-selector-demo8 .btn-animate-go button').on('click', function(e) {
		blockTest8.restart();
	});
}
