// function init
//  more option https://github.com/airbnb/lottie-web
function lottiefilesInit() {
	// variant 1
	var svgContainer = document.querySelectorAll('.lottiefile-svgContainer');
	for(var i = 0; i < svgContainer.length; i++) {
		var animItem = bodymovin.loadAnimation({
		wrapper: svgContainer[i],
		animType: 'svg',
		loop: true,
		path: 'https://labs.nearpod.com/bodymovin/demo/markus/isometric/markus2.json'
	});
	}

	// variant 2
	var svgContainer2 = document.getElementById('lottiefile-svgContainer2');
	var animItem2 = bodymovin.loadAnimation({
		wrapper: svgContainer2,
		animType: 'svg',
		loop: true,
		autoplay: false,
		path: 'https://labs.nearpod.com/bodymovin/demo/markus/isometric/markus2.json'
	});
	var play = document.getElementById('lottiefile-button-start')
	play.addEventListener('click', () => {
		animItem2.goToAndPlay(0, true);
	})
	var play = document.getElementById('lottiefile-button-end')
	play.addEventListener('click', () => {
		animItem2.pause();
	})
}

