/* module spin */
// function on
jQuery(document).ready(function() {
	spinInit();
});
// function init
// more option https://github.com/zarocknz/javascript-winwheel or http://dougtesting.net/home
// also don't forget connect gsap
function spinInit() {
	let theWheel = new Winwheel({
		'canvasId': 'winwheel-canvas', // canvasId
		'numSegments': 8, // Number of segments
		'outerRadius': 220, // The size of the wheel.
		'centerX': 220, // Used to position on the background correctly.
		'centerY': 220,
		'textFontSize': 28, // Font size.
		'segments': // Definition of all the segments.
			[{ 'fillStyle': '#eae56f', 'text': 'Prize 1' }, { 'fillStyle': '#89f26e', 'text': 'Prize 2' }, { 'fillStyle': '#7de6ef', 'text': 'Prize 3' }, { 'fillStyle': '#e7706f', 'text': 'Prize 4' }, { 'fillStyle': '#eae56f', 'text': 'Prize 5' }, { 'fillStyle': '#89f26e', 'text': 'Prize 6' }, { 'fillStyle': '#7de6ef', 'text': 'Prize 7' }, { 'fillStyle': '#e7706f', 'text': 'Prize 8' }],
		'animation': // Definition of the animation
		{
			'type': 'spinToStop',
			'duration': 5,
			'spins': 8,
			'callbackFinished': alertPrize
		}
	});
	// Called when the animation has finished.
	function alertPrize(indicatedSegment) {
		alert("You have won " + indicatedSegment.text);
	}

	var btnwinwheel = document.getElementById('winwheel-canvas-button');
	btnwinwheel.addEventListener('click', () => {
		theWheel.startAnimation();
	})
}
